angular.module("Repository",["BusinessRules","Session"]).service("Repository",["UserRules","Session",function(a,b){this.signIn=function(c,d){a.signIn(c,function(a){0==a.length&&b.login(c),d(a)})},this.signUp=function(c,d){a.signUp(c,function(a){0==a.length&&b.login(c),d(a)})},this.userInfo=function(b){a.userInfo(b)},this.getId=function(a){b.getId(a)}}]);